[C#]
Aspose.BarCode.BarCodeBuilder b = new BarCodeBuilder();
b.CodeText = "12345678";
b.SymbologyType = Aspose.BarCode.SymbologyType.Codabar;
b.BarCodeImage.Save("test.bmp");

[VB.NET]
dim b as Aspose.BarCode.BarCodeBuilder
b = new BarCodeBuilder()
